import './App.css';

function App() {
  return (
    <div className="App">
      <label>Product Type</label>
    <input type="text"/>
    <label>Quantity</label>
    <input type="number"/>
    <label>Price</label>
    <input type="text"/>
    <button> Add to List</button>
    </div>
  );
}

export default App;
